import React from 'react';

const style = {
	container: {
		width: '80%',
		height: '5%',
		backgroundColor: '#24232C'
	}
}

const passwordDisplayer = ({ password }) => {
	return (
		<div style={style.container}>
			{password}
		</div>
	);
};

export default passwordDisplayer;
